import React from "react";
import './App.css'
import { AppBar, Toolbar, Typography, Button } from '@material-ui/core'
import Signup from './components/screens/Signup';

const button1 = {marginLeft:"600px", fontSize:"15px"};
const button2 = {marginLeft:"700px", fontSize:"15px"};
const title = {fontFamily: "'Akaya Telivigala', cursive", fontSize:"20px"};
const Navbar2 = () => {


    return (
        <>

                <AppBar position="static" style={{backgroundColor: "white", color:"black"}}>

                    <Toolbar>
                        <Typography variant="h6" style={title}  >
                            Okay-Social
                        </Typography>
                        <Button style={button1}>Signin</Button>
                        <Button style={button2}>Signup</Button>
                    </Toolbar>
                </AppBar>

        </>
    );
};

export default Navbar2;
